@Component({
    selector: 'app-detalles-obra', // Asegúrate de tener el selector correcto
    templateUrl: './detalles-obra.component.html',
    styleUrls: ['./detalles-obra.component.css']
})
export class DetallesObraComponent implements OnInit {
  seatData: any; // Tus datos de asientos

  constructor() {}

  ngOnInit(): void {
      this.loadSeatData();
  }

  loadSeatData(): void {
      // Cargar datos de asientos aquí (p.ej., desde un servicio)
      this.seatData = { /* ... */ };

      $('.example').seatLayout({
          data: this.seatData,
          // ... otras opciones
      });
  }
}


